    protected override async Task OnInitializedAsync()
    {
        registerModel = new RegisterViewModel();
        registerModel.Dob = DateTime.Now;
        CountryList = new List<Country>();
        CountryList = await userService.GetCountryListAsync();
        Loader = "none";
